// LoadInterpretationAiInterpretation loads the interpretationItem's InterpretationAiInterpretation into the .R struct
func (o *InterpretationItem) LoadInterpretationAiInterpretation(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.InterpretationAiInterpretation = nil

	related, err := o.InterpretationAiInterpretation(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.InterpretationInterpretationItems = InterpretationItemSlice{o}

	o.R.InterpretationAiInterpretation = related
	return nil
}

// LoadInterpretationAiInterpretation loads the interpretationItem's InterpretationAiInterpretation into the .R struct
func (os InterpretationItemSlice) LoadInterpretationAiInterpretation(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	aiInterpretations, err := os.InterpretationAiInterpretation(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range aiInterpretations {

			if !(o.InterpretationID == rel.ID) {
				continue
			}

			rel.R.InterpretationInterpretationItems = append(rel.R.InterpretationInterpretationItems, o)

			o.R.InterpretationAiInterpretation = rel
			break
		}
	}

	return nil
}

